import React, { Component } from 'react';
import { Link } from "react-router-dom";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';
  import { InputGroup, InputGroupAddon, InputGroupText, Input , Form, FormGroup,Button } from 'reactstrap';
  import { faSearch } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
  






  export default class Header extends React.Component {
    constructor(props) {
      super(props);
  
      this.toggle = this.toggle.bind(this);
      this.state = {
        isOpen: false
      };
    }
    toggle() {
      this.setState({
        isOpen: !this.state.isOpen
      });
    }
    render() {
      return (
        <div>
          <Navbar color="" light expand="md">
            <NavbarBrand to="/">
            <Form>    
            <InputGroup>
              <Input placeholder="ابحث عن الدرس..." />
              <InputGroupAddon addonType="append">
                <InputGroupText><FontAwesomeIcon icon={faSearch}></FontAwesomeIcon> </InputGroupText>
              </InputGroupAddon>
             </InputGroup>
      </Form>
              
            </NavbarBrand>
            <NavbarToggler onClick={this.toggle} />
            <Collapse isOpen={this.state.isOpen} navbar>
              <Nav className="ml-auto" navbar>
                <NavItem>
                  <NavLink to="/"><Link to="/learn">تواصل معنا</Link></NavLink>
                </NavItem>
                <UncontrolledDropdown nav inNavbar>
                  <DropdownToggle nav caret>
                    المنهج
                  </DropdownToggle>
                  <DropdownMenu right>
                    <DropdownItem>
                    <NavLink to="/learn"><Link to="/learn">1 الصفحة</Link></NavLink>
                    </DropdownItem>
                    <DropdownItem>
                    <NavLink to="/learn"><Link to="/learn">2الصفحة</Link></NavLink>
                    </DropdownItem>
                    <DropdownItem divider />
                    <DropdownItem>
                    <NavLink to="/learn"><Link to="/learn">3 الصفحة</Link></NavLink>
                    </DropdownItem>
                  </DropdownMenu>
                </UncontrolledDropdown>
                <NavItem>
                  <NavLink to="/learn"><Link to="/learn">الصفحة الرئسية</Link></NavLink>
                </NavItem>
              </Nav>
            </Collapse>
          </Navbar>
        </div>
      );
    }
  }
